import React from "react";
import Button from "./button";
import Pic from "../bgimg2.png";
import Navbarr from "./navbar";
import Footer from "./footer";
import "../styleComponents/page2.css"

const Page2 = () => {
    return (
        <>
            <Navbarr />
    <div id="pg2" className="container">
      <div className="row">
        <div className="text-content col-6">
                  <h2>Select your semester!</h2>
                  <Button btn_text="Semester 1" />
                  <Button btn_text="Semester 2" />
        </div>
        <div
          className="img-content col-6
              "
              >
                  <img className="img2" src={Pic} alt="img2" height="35%"/>
        </div>
      </div>
            </div>
            <Footer />
            </>
  );
};

export default Page2;
